import { FormGroup, Input, Label } from 'reactstrap';
import CardSection from './CardSection';

const CheckOutForm = () => {
  return (
    <div>
      <h5>あなたの情報</h5>
      <hr />
      <FormGroup>
        <div>
          <Label>住所</Label>
          <Input name="address" />
        </div>
      </FormGroup>
      <CardSection />
    </div>
  );
};

export default CheckOutForm;
